import React from 'react';
import './App.css'
import { Paper } from "@material-ui/core";
import WeatherComponent from "./component/Weather";

function App() {
  return (
    <div>
      <Paper className="paper">
        <WeatherComponent/>
      </Paper>
    </div>
  );
}

export default App;
